exports.command = function(edi1, edi2, edi3, edi4, edi5, edi6, edi7, edi8,zz,a1,b1,c1,city,address,doctor,email){
	this
	.useCss()
	.getAttribute('#clinicname' , 'value' , function(result){
  edi1.push(result.value)                   
})

.getAttribute('#clinicphone' , 'value' , function(result){
    var aa=result.value[1]+result.value[2]+result.value[3]+result.value[6]+result.value[7]+result.value[8]+result.value[10]+result.value[11]+result.value[12]+result.value[13]
     edi2.push(aa)
})

.getAttribute('#zipcode' , 'value' , function(result){
    edi3.push(result.value)
})

.getAttribute('#doctorphone' , 'value' , function(result){
  var bb=result.value[0]+result.value[1]+result.value[3]+result.value[4]+result.value[5]+result.value[6]+result.value[7]+result.value[8]+result.value[9]
    edi4.push(bb)
})

.getAttribute('#city' , 'value' , function(result){ 
    edi5.push(result.value)
})

.getText('#address' , function(result){ 
    edi6.push(result.value)
})

.getAttribute('#physicianname' , 'value' , function(result){
    edi7.push(result.value)
})

.getAttribute('#emailId' , 'value' , function(result){
    edi8.push(result.value)
})
this

     .verify.valueContains('#clinicname' , zz+' clinic')
     .verify.valueContains('#clinicphone' , '('+a1.toString().substring(0, 3)+') '+a1.toString().substring(3, 6)+'-'+a1.toString().substring(6, 10))
     .verify.valueContains('#zipcode' , b1)
     .verify.valueContains('#doctorphone' , c1.toString().substring(0, 2)+'-'+c1.toString().substring(2, 9))
     .verify.valueContains('#city' , city+' test')
     .verify.containsText('#address' , address+' test')
     .verify.valueContains('#physicianname' , doctor+' MBBS')
     .verify.valueContains('#emailId' , 'test'+email)
}